import { StyleSheet } from "react-native";

const styles = StyleSheet.create({
  price: {
    height: 28,
    paddingHorizontal: 8,
    backgroundColor: "rgba(255, 255, 255, 0.35)",
    justifyContent: "center",
    borderRadius: 4,
  },
});

export default styles;
